import "./nav.css";

const Nav = () => {
    return (
        <div className="navbar">
            <div className="navbar-title">
                <h2>No Name</h2>
            </div>
            <div className="navbar-item">
                <a href="/" className = "main">Main Page</a>
                <a href="/assignments" className="assignment">Assignment</a>
            </div>
        </div>
    );
}

export default Nav;
